INSERT INTO workshop.team (id,weight, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, name, full_name, status, filial, position, department, email, phone, birth, address, photo, about) VALUES (3,30, 1585612800, 1, null, null, null, null, 'Павел', 'Шиляев Павел Алексеевич', 'Участник', 'Москва', 'Заместитель начальника отдела', 'Отдел организации продаж по Московскому региону', 'pavel.shilyaev@rt.ru', '84958555328', 651542400, '108811, Российская Федерация, г. Москва, км Киевское шоссе 22-й (п Московский), д. 6, строение 1', '3.jpg', 'Идеальная работа - это: Работа, где можно проявить себя. Работа, в которой руководитель поддерживает инициативы. Работа, в котрой развивается проектный подход в реализации бизнес-процессы<br>Три вещи, которые я люблю: Обучение, Путешествия, результат от работы<br>Три качества, которые ценю в себе: Результативность, Креативность, Планировнаие<br>Если досуг, то: Командный<br>Меня мотивирует: Результат от моей работы, Моя команда');
INSERT INTO workshop.team (id,weight, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, name, full_name, status, filial, position, department, email, phone, birth, address, photo, about) VALUES (4,40, 1585612800, 1, null, null, null, null, 'Никита', 'Цыганков Никита Олегович', 'Участник', 'Москва', 'Руководитель направления', 'Отдел организации продаж по Московскому региону', 'nikita.tsygankov@rt.ru', '84958555316', 623721600, '108811, Российская Федерация, г. Москва, км Киевское шоссе 22-й (п Московский), д. 6, строение 1', '4.jpg', 'Идеальная работа - это: Работа, в котрой я приношу пользу.
INSERT INTO workshop.team (id,weight, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, name, full_name, status, filial, position, department, email, phone, birth, address, photo, about) VALUES (5,50, 1585612800, 1, null, null, null, null, 'Роман', 'Игнатович Роман Сергеевич', 'Участник', 'Москва', 'Ведущий специалист', 'Отдел организации продаж по Московскому региону', 'roman.ignatovich@rt.ru', '84958555347', 672969600, '108811, Российская Федерация, г. Москва, км Киевское шоссе 22-й (п Московский), д. 6, строение 1', '5.jpg', 'Идеальная работа - это: работа, которая приносит удовольствие, во всех смыслах этого слова. Которая позволяет раскрывать потенциал человека, предоставляет решение разнообразных задач, отличается креативностью, помогает улучшить эффективность как человека, так и деятельности, которой он занимается.<br/>Три вещи, которые я люблю: Музыка, проведение тренингов и игр, авиация<br/>Три качества, которые ценю в себе: Детальность, планирование, видение перспективы<br/>Если досуг, то: активный и интересный<br/>Меня мотивирует: Быть полезным для окружающих; разнообразие выполняемых задач; познание неизученного мной; улучшение своего материального положения; взможность поделиться своим опытом и знаниями.');
INSERT INTO workshop.team (id,weight, created_at, created_by, updated_at, updated_by, deleted_at, deleted_by, name, full_name, status, filial, position, department, email, phone, birth, address, photo, about) VALUES (6,60, 1585612800, 1, null, null, null, null, 'Юлия', 'Шилкина Юлия Михайловна', 'Участник', 'Тверской филиал', 'Руководитель группы', 'Группа производственного контроля', 'yuliya_shilkina@center.rt.ru', '84822320611', 586396800, '170100, Российская Федерация, Тверская обл., г. Тверь, ул. Симеоновская, д. 28', '6.jpg', 'Идеальная работа - это: интересная работа<br>Три вещи, которые я люблю: Путешествие, хороший сон, открытие новых вкусов<br>Три качества, которые ценю в себе: Отзывчивость, целеустремленность, доброта<br>Если досуг, то: Интересный и разнообразный<br>Меня мотивирует: Моя семья');
